import React, { useEffect, useState } from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { getTeamByLeague } from './API';
import './Teams.css';
function Teams() {
  // const teamsData = [
  //   {
  //     name: 'Exodus',
  //     branding: {
  //       primary: 'blue',
  //       secondary: 'darkblue',
  //       logo: '',
  //     },
  //     league: 'Flux Cup',
  //     season: 1,
  //   },
  //   {
  //     name: 'Volcanic',
  //     branding: {
  //       primary: 'red',
  //       secondary: 'darkred',
  //       logo: '',
  //     },
  //     league: 'Flux Cup',
  //     season: 1,
  //   },
  //   {
  //     name: 'Soar Academy',
  //     branding: {
  //       primary: 'yellow',
  //       secondary: 'lightblue',
  //       logo: '',
  //     },
  //     league: 'Flux Cup',
  //     season: 1,
  //   },
  // ];
  useEffect(() => {
    getTeamByLeague().then((out) => setTeamByLeague(out));
  }, []);

  const [teamByLeague, setTeamByLeague] = useState(false);
  return (
    <Container className='gen-page text-light' fluid>
      <Container>
        <Row>
          <Col className='p-3' md={12}>
            <center>
              <h1>Teams</h1>
              <h3>View Teams and their players below!</h3>
            </center>
          </Col>
        </Row>
        <Row>
          <div className='g-2'>
            {teamByLeague &&
              Object.entries().map(([key, value]) => {
                return (
                  <Row>
                    <h1>{key}</h1>
                    {value.map((e) => (
                      <Col
                        className='g-1'
                        style={{
                          background: e.branding.primary,
                          height: '100px',
                        }}
                        md={4}
                      >
                        <div
                          style={{
                            background: e.branding.secondary,
                            color: 'black',
                            fontSize: '1.5rem',
                            textAlign: 'center',
                          }}
                        >
                          {`${e.name} | ${e.season}`}
                        </div>
                      </Col>
                    ))}
                  </Row>
                );
              })}
          </div>
        </Row>
      </Container>
    </Container>
  );
}

export default Teams;
